   "source": [
    "processing the image data files. \n",
    "metadata contains image tag as well as how the classification of each image was attained. \n",
    "\n",
    "images are set out in two files part 1 and part 2 \n",
    "\n",
    "metadata csv contains lesiod id along with tagging infor re classification aswell as classificaion method. test set is noit public - split this data into test and train oro see if the evaluation server is suitable?\n",
    "\n",
    "first step is to clean the dtaa and check that all images have a corresponding tag and apply this to the associated image.? image location is listed along with gedaer and age. dx_type = method of classification, dx = type of cancer / classification decision. two varaiables image id and lesion id. \n",
    "\n",
    "set seed then split to test and train 75/25 split favouring training. \n",
    "\n",
    "check some simple frequencies to have a look at pt. demographics like age and gender a;though ethnicity isnt included - there may be an underrepresentation of non white individuals in the images - this will need to be checked by reviewing some of the images - this is a common and historic underrepresentation esspecially in cancers that are harder to detect in non white individuals due to colour similarities between some leisions and general healthy skin. \n",
    "\n",
    "images are within additional files. \n",
    "\n",
    "\n",
    "can see from preview duplicate leision id with different image id - HAM_0007010,ISIC_0031691, ISIC_0025419, same with leisionid HAM_0002299 - could this be multiple leisions in same location? or multiple images of the same leision? lots of duplicates in preview - seems like more duplicates than single entries - this needs to be checked looking at the whole file and run a code to check - may need to hand inspect the associated images to see if they are copies of if they are angles/lighting changes etc or if multiple lesions. "
   ]
  },
